    }

        border: 0;
    }

        border: 0;
    }

        box-sizing: content-box;
        height: 0;
    }

        margin: 15px 0;

        background: transparent;
        border: 0;
        border-bottom: 1px solid #ddd;
    }

        display: table;
        content: "";
    }

        display: table;
        clear: both;
        content: "";
    }

        padding: 0;
        margin: 16px 0;
        background-color: #e7e7e7;
        border: 0 none;
    }

        text-decoration: none;
    }

        text-decoration: none;
    }

    a {
        background-color: transparent;
    }

    a:active,

        outline: 0;

    }

    }

        }

        }

            display: none;
        }

        value %= 3600;
